#include <potion.h>
#include <stdlib.h>

void load_head(pt_mesh* mesh) {
	static int prepared = 0;

	unsigned int i;
	if (!prepared) {
		for (i = 0; i < vertex_count[0]; i++) {
			vertices[i].v = 1.0f - vertices[i].v;
		}

		prepared = 1;
	}

	mesh->vertexCount = vertex_count[0];
	mesh->vertices = malloc(mesh->vertexCount * sizeof(pt_vertex));
	
	for (i = 0; i < mesh->vertexCount; i++) {
		mesh->vertices[i].position.x = vertices[i].x;
		mesh->vertices[i].position.y = vertices[i].y;
		mesh->vertices[i].position.z = vertices[i].z;

		mesh->vertices[i].normal.x = vertices[i].nx;
		mesh->vertices[i].normal.y = vertices[i].ny;
		mesh->vertices[i].normal.z = vertices[i].nz;

		mesh->vertices[i].texcoord.x = vertices[i].u;
		mesh->vertices[i].texcoord.y = vertices[i].v;
	}

	for (i = 0; i < mesh->vertexCount; i += 3) {
		pt_vec3 delta_pos1, delta_pos2;
		pt_vec3_subtract(&delta_pos1, &mesh->vertices[i + 1].position, &mesh->vertices[i].position);
		pt_vec3_subtract(&delta_pos2, &mesh->vertices[i + 2].position, &mesh->vertices[i].position);

		pt_vec2 delta_uv1, delta_uv2;
		pt_vec2_subtract(&delta_uv1, &mesh->vertices[i + 1].texcoord, &mesh->vertices[i].texcoord);
		pt_vec2_subtract(&delta_uv2, &mesh->vertices[i + 2].texcoord, &mesh->vertices[i].texcoord);

		float r = 1.0f / (delta_uv1.x * delta_uv2.y - delta_uv1.y * delta_uv2.x);
		pt_vec3 tangent;
		tangent.x = (delta_pos1.x * delta_uv2.y - delta_pos2.x * delta_uv1.y) * r;
		tangent.y = (delta_pos1.y * delta_uv2.y - delta_pos2.y * delta_uv1.y) * r;
		tangent.z = (delta_pos1.z * delta_uv2.y - delta_pos2.z * delta_uv1.y) * r;

		pt_vec3 bitangent;
		bitangent.x = (delta_pos2.x * delta_uv1.x - delta_pos1.x * delta_uv2.x) * r;
		bitangent.y = (delta_pos2.y * delta_uv1.x - delta_pos1.y * delta_uv2.x) * r;
		bitangent.z = (delta_pos2.z * delta_uv1.x - delta_pos1.z * delta_uv2.x) * r;

		mesh->vertices[i].tangent = tangent;
		mesh->vertices[i + 1].tangent = tangent;
		mesh->vertices[i + 2].tangent = tangent;

		mesh->vertices[i].bitangent = bitangent;
		mesh->vertices[i + 1].bitangent = bitangent;
		mesh->vertices[i + 2].bitangent = bitangent;
	}

	mesh->indexCount = faces_count[0] * 3;
	mesh->indices = malloc(mesh->indexCount * sizeof(unsigned int));

	for (i = 0; i < mesh->indexCount; i++) {
		mesh->indices[i] = indexes[i];
	}

	mesh->vertexType = PT_VERTEX_POSITION | PT_VERTEX_TEXCOORD | PT_VERTEX_NORMAL;
}